import React from "react";
import "./Button.scss";

const Button = () => {
  const pushButton = () => {};

  return (
    <div>
      <button onClick={() => pushButton()}>
        <i class="fab fa-twitter"></i>
      </button>
    </div>
  );
};

export default Button;
